import React from 'react';
import HomeIcon from '@mui/icons-material/Home';
import TravelExploreIcon from '@mui/icons-material/TravelExplore';
import BarChartIcon from '@mui/icons-material/BarChart';
import SettingsIcon from '@mui/icons-material/Settings';
import { AddReaction, Article, AttachMoney, EngineeringTwoTone, Handshake, HolidayVillage, HouseTwoTone, HowToRegTwoTone, PeopleTwoTone, ReportProblem } from '@mui/icons-material';
 
export const navData = [
    {
        id: 0,
        icon: <HomeIcon/>,
        text: "Home",
        link: "/"
    },
    {
        id: 1,
        icon: <AttachMoney/>,
        text: "Rentals",
        link: "payRent"
    },
    {
        id: 2,
        icon: <HomeIcon/>,
        text: "Apartments",
        link: "statistics"
    },
    {
        id: 3,
        icon: <HolidayVillage/>,
        text: "Allocated Units",
        link: "rentals"

    },
    {
        id: 4,
        icon: <Handshake/>,
        text: "Lease Agreements",
        link: "LeaseAgreement"
    }, 
    {
        id: 5,
        icon: <HowToRegTwoTone/>,
        text: "Credit Applications",
        link: "LeaseAgreement"
    },
    {
        id: 6,
        icon: <AddReaction/>,
        text: "New Applicants",
        link: "LeaseAgreement"
    },
    {
        id: 7,
        icon: <EngineeringTwoTone/>,
        text: "Maintenance Jobs",
        link: "LeaseAgreement"
    },
    {
        id: 8,
        icon: <HouseTwoTone/>,
        text: "Club House",
        link: "LeaseAgreement"
    }, 
    {
        id: 9,
        icon: <ReportProblem/>,
        text: "Complaints/Disturbances",
        link: "LeaseAgreement"
    },
    {
        id: 10,
        icon: <PeopleTwoTone/>,
        text: "Visitor Reports",
        link: "LeaseAgreement"
    }
]
